import React from 'react';
import style from'../styles/aboutUs.css'

export default class AboutUs extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        return (
            <div className={style.page}>

            </div>
        )
    }
    componentDidMount() {
        window.show();
        window.showToast('123')
        // window.axios({
        //     url: window.API.Mine.info
        // })
    }
}
